import React, { Component } from "react";
import got1 from "../images/Got1.png";
export default class Featured extends Component {
  render() {
    return (
      <div>
        <div class="m-auto text-center pt-5">
          <h2>Featured</h2>
        </div>
        <div class="container">
          <div style={{border}}>
            <div>
              <img
                src={got1}
                class="card-img-top"
                alt="..."
                style={{ borderRadius: "22.5px" }}
              />
            </div>
            <div class="">
              <h5 class="card-title text-center">Card title</h5>
            </div>
            {/* <div style={{ width: "375px", height: "250px",paddingRight:'50px', }}>
                        <img src={got1} class="card-img-top" alt="..." style={{borderRadius:'22.5px'}}/>
              <div class="card-body">
                <h5 class="card-title text-center">Card title</h5>
              </div>
            </div> */}
            {/* <div style={{ width: "375px", height: "250px",paddingRight:'50px', }}>
                        <img src={got1} class="card-img-top" alt="..." style={{borderRadius:'22.5px'}}/>
              <div class="card-body">
                <h5 class="card-title text-center">Card title</h5>
              </div>
            </div> */}
          </div>
        </div>
      </div>
    );
  }
}
